                        <label htmlFor="">Логин </label>
                        <input
                              className="form-control"
                              type="text"
                              required
                              //onChange={(e) => setName(e.target.value)}
                              name="name"

                              //value={name}
                              id="name"
                              placeholder="Введите логин" />

                        <label htmlFor=""> Пароль</label>
                        <input type="password"
                              className="form-control"
                              type="text"
                              required
                              //onChange={(e) => setName(e.target.value)}
                              name="name"

                              //value={name}
                              id="name"
                              placeholder="Введите логин"
                        />

                        <button>отправить</button>
                  </form>

            </div>
      );
}

export default FormRegisr;
